export default function Concepts(props) {
  return (
    <div>
        <li className="concept">
          <img src={props.concepts.image} alt={props.concepts.title} />
          <h2>{props.concepts.title}</h2>
          <p>{props.concepts.description}</p>
        </li>
    </div>
  );
}
